import React from 'react'


const Navbar = () => {
  const emp_id = JSON.parse(window.sessionStorage.getItem('emp_id'));
    const handleLogout=()=>{
      console.log("hi");
        sessionStorage.clear();
        window.location.reload(true);
    }
  return (
    <>
        <nav className="d-flex justify-content-between navbar navbar-expand-lg navbar-light bg-light">
        <a class="navbar-brand" href="#"><img src='https://www.iiitb.ac.in/includefiles/userfiles/images/IIITB%20Silver%20Jubilee%20Logo.jpg' width="50" height="45" alt="" style={{verticalAlign:'middle'} } ></img></a>
        <p class="User" style={{color:'black'}}>Hi,{emp_id.employeeName} !!</p>
        <form class="form-inline my-2 my-lg-0">
          <button type="submit" onClick={handleLogout} className="btn btn-danger navbar-btn">Logout</button>
        </form>
        </nav>
    </>
  )
}

export default Navbar
